	public static String getImageStr(String imgFilePath) {// Base64
		byte[] data = null;

		// 
		try {
			InputStream in = new FileInputStream(imgFilePath);
			data = new byte[in.available()];
			in.read(data);
			in.close();
		} catch (IOException e) {
			e.printStackTrace();
		}

		// Base64
		BASE64Encoder encoder = new BASE64Encoder();
		return encoder.encode(data);// Base64
	}

	public static boolean createImageFile(String imgStr, String imgFilePath) {// Base64
		if (imgStr == null) // 
			return false;
		BASE64Decoder decoder = new BASE64Decoder();
		try {
			// Base64
			byte[] bytes = decoder.decodeBuffer(imgStr);
			for (int i = 0; i < bytes.length; ++i) {
				if (bytes[i] < 0) {// 
					bytes[i] += 256;
				}
			}
			// jpeg
			OutputStream out = new FileOutputStream(imgFilePath);
			out.write(bytes);
			out.flush();
			out.close();
			return true;
		} catch (Exception e) {
			return false;
		}
	}

	
